import PageTitle from "../../Layout/Components/PageTitle.vue";
export default {
  components: {
    PageTitle: PageTitle
  },
  data: function data() {
    return {
      heading: 'Progress Bar',
      subheading: 'You can use the progress bars on their own or in combination with other widgets.',
      icon: 'pe-7s-filter icon-gradient bg-grow-early',
      counter: 45,
      max: 100,
      bars: [{
        variant: 'success',
        value: 75
      }, {
        variant: 'info',
        value: 75
      }, {
        variant: 'warning',
        value: 75
      }, {
        variant: 'danger',
        value: 75
      }, {
        variant: 'primary',
        value: 75
      }, {
        variant: 'secondary',
        value: 75
      }, {
        variant: 'dark',
        value: 75
      }, {
        variant: 'alternate',
        value: 75
      }, {
        variant: 'focus',
        value: 75
      }],
      timer: null,
      striped: true,
      value: 75
    };
  },
  methods: {
    clicked: function clicked() {
      this.counter = Math.random() * this.max;
      console.log('Change progress to ' + Math.round(this.counter * 100) / 100);
    }
  },
  mounted: function mounted() {
    var _this = this;

    this.timer = setInterval(function () {
      _this.bars.forEach(function (bar) {
        return bar.value = 25 + Math.random() * 75;
      });
    }, 2000);
  },
  beforeDestroy: function beforeDestroy() {
    clearInterval(this.timer);
    this.timer = null;
  }
};
